import React from 'react'
import '../style/PopUpLogin.css'

const PopUpLogin = (props) => {
  return (props.trigger)? (
    <div className='popup'>
      <div className='popup-inner'>

            {props.children}
      </div>
    </div>
  ): "";
}

export default PopUpLogin
